import { Menu, MenuProps, Space } from 'antd';

import {
    HomeOutlined, 
    ShoppingCartOutlined, 
    ExperimentOutlined, 
    SendOutlined,
    HeartOutlined,
    FireOutlined,
    UserOutlined
    } from '@ant-design/icons';
import React from 'react';

type MenuItem = Required<MenuProps>['items'][number];

function getItem(
    label: React.ReactNode,
    key: React.Key,
    icon?: React.ReactNode,
    children?: MenuItem[],
  ): MenuItem {
    return {
      key,
      icon,
      children,
      label,
    } as MenuItem;
  }

const items: MenuItem[] = [
    getItem('Home', 'home', <HomeOutlined/>),
    getItem('Products', 'products', <ExperimentOutlined />),
    getItem('Cart', 'cart', <ShoppingCartOutlined />),
    getItem('Account', 'account', <UserOutlined />),
    getItem('Contact', 'contact', <SendOutlined />)
]

let menuOptions: MenuItem[] = [
    {
        key: 'home',
        label: 'Home',
        icon: <HomeOutlined />,
        type: 'group',
    },
    {
        key: 'products',
        label: 'Products',
        icon: <ShoppingCartOutlined />,
        type: 'group',
    },
    {
        key: 'cart',
        label: 'Cart',
        icon: <ExperimentOutlined />,
        type: 'group',
    },
    {
        key: 'contact',
        label: 'Contact',
        icon: <SendOutlined />,
        type: 'group',
    },
    {
        key: 'account',
        label: 'Account',
        icon: <HeartOutlined />,
        type: 'group',
    },
    {
        key: 'forums',
        label: 'Forums',
        icon: <FireOutlined />,
        type: 'group',
    }
]


interface StandardNavbarProps {
    menuChoice: string;
    menuChoiceSetter: (menuChoice: string) => void;
}

export function StandardNavbar({ menuChoice, menuChoiceSetter } : StandardNavbarProps ) {


    return (
        <Space direction='vertical' style={{width: '100%' }}>
            <Menu mode="inline" selectedKeys={[menuChoice]} items={menuOptions}/>
        </Space>
    );
}
